    by states, in accordance with the current method of displaying MMWR data.  Data
    on United States will exclude counts from US territories.  Footnote:C.N.M.I.: Commonwealth
    of Northern Mariana Islands. U: Unavailable.    -: No reported cases.    N: Not
    reportable.    NN: Not Nationally Notifiable    Cum: Cumulative year-to-date counts.
       Min: Minimum.    Max: Maximum. * Case counts for reporting year 2014 and 2015
    are provisional through the end of the quarter,  January 2, 2016. For further information
    on interpretation of these data, see <a href="http://wwwn.cdc.gov/nndss/document/ProvisionalNationaNotifiableDiseasesSurveillanceData20100927.pdf">http://wwwn.cdc.gov/nndss/document/ProvisionalNationaNotifiableDiseasesS...</a>
